//==================================================================================================
//| 函数名称 | Sound_Config
//|----------|--------------------------------------------------------------------------------------
//| 函数功能 | 配置PA.8作为PWM口，用于输出声音(TIM1_CH1)
//|----------|--------------------------------------------------------------------------------------
//| 调用模块 | 	无
//|----------|--------------------------------------------------------------------------------------
//| 输入参数 |	无
//|----------|--------------------------------------------------------------------------------------       
//| 返回参数 | 	无
//|----------|--------------------------------------------------------------------------------------       
//| 全局变量 |  无
//|----------|-------------------------------------------------------------------------------------- 
//| 函数设计 | 编写人：郑海    时间：2013-08-25
//|----------|-------------------------------------------------------------------------------------- 
//|   备注   | 
//|----------|-------------------------------------------------------------------------------------- 
//| 修改记录 | 修改人：          时间：         修改内容： 
//==================================================================================================
void SoundConfig(void)
{
	GPIO_InitTypeDef GPIO_InitStructure;
	TIM_TimeBaseInitTypeDef TIM_TimeBaseStructure;
	TIM_OCInitTypeDef TIM_OCInitStructure;
	NVIC_InitTypeDef NVIC_InitStructure;

	/***GPIO时钟配置***/
	RCC_AHB1PeriphClockCmd(SOUND_PWM_PORT_RCC | SOUND_SW_PORT_RCC, ENABLE);	
	
	/* TIM4 clock enable */
  	RCC_APB1PeriphClockCmd(RCC_APB1Periph_TIM4, ENABLE); 
	
	/***声音电源管脚***/
	GPIO_InitStructure.GPIO_Pin = SOUND_SW_PIN;  
	GPIO_InitStructure.GPIO_Mode = GPIO_Mode_OUT;
	GPIO_InitStructure.GPIO_OType = GPIO_OType_PP;
	GPIO_InitStructure.GPIO_Speed = GPIO_Speed_50MHz;
	GPIO_InitStructure.GPIO_PuPd = GPIO_PuPd_NOPULL;
	GPIO_Init(SOUND_SW_PORT, &GPIO_InitStructure);
	
	/***关闭声音芯片电源***/
	CLOSE_SOUND_SW();	

	GPIO_PinAFConfig(GPIOD, GPIO_PinSource13, GPIO_AF_TIM4);

	GPIO_InitStructure.GPIO_Pin = SOUND_PWM_PIN;  //PD.13用于PWM,产生声音
	GPIO_InitStructure.GPIO_Mode = GPIO_Mode_AF;
	GPIO_InitStructure.GPIO_OType = GPIO_OType_PP;
	GPIO_InitStructure.GPIO_Speed = GPIO_Speed_100MHz;
	GPIO_InitStructure.GPIO_PuPd = GPIO_PuPd_DOWN;//下拉，默认为低电平
	GPIO_Init(SOUND_PWM_PORT, &GPIO_InitStructure);
	
	TIM_TimeBaseStructure.TIM_Prescaler = 0;//设置预分频：不预分频
	TIM_TimeBaseStructure.TIM_CounterMode = TIM_CounterMode_Up;//向上计数模式
	TIM_TimeBaseStructure.TIM_Period = 537/2; //84M,周期为6.4us      
	TIM_TimeBaseStructure.TIM_ClockDivision = TIM_CKD_DIV1 ;   //设置时钟分频系数：不分频
	TIM_TimeBaseStructure.TIM_RepetitionCounter = 0x00;
	TIM_TimeBaseInit(TIM4, &TIM_TimeBaseStructure);

	TIM_OCInitStructure.TIM_OCMode = TIM_OCMode_PWM1;//配置为PWM模式1
	TIM_OCInitStructure.TIM_OutputState = TIM_OutputState_Enable;
	TIM_OCInitStructure.TIM_OutputNState = TIM_OutputNState_Disable;
	TIM_OCInitStructure.TIM_Pulse = WavSoundData1[0];  //设置跳变值，当计数器计数到这个值时，电平发生跳变
	TIM_OCInitStructure.TIM_OCPolarity = TIM_OCPolarity_High; //当定时器计数值小于.TIM_Pulse 时为低电平
	TIM_OCInitStructure.TIM_OCNPolarity = TIM_OCNPolarity_Low;
	TIM_OCInitStructure.TIM_OCIdleState = TIM_OCIdleState_Set;
	TIM_OCInitStructure.TIM_OCNIdleState = TIM_OCIdleState_Set;

	TIM_OC2Init(TIM4, &TIM_OCInitStructure);
	TIM_OC2PreloadConfig(TIM4, TIM_OCPreload_Enable);
	
	/*中断配置*/
	NVIC_InitStructure.NVIC_IRQChannel = TIM5_IRQn;
	NVIC_InitStructure.NVIC_IRQChannelPreemptionPriority = 0x00;
	NVIC_InitStructure.NVIC_IRQChannelSubPriority = 0x00;
	NVIC_InitStructure.NVIC_IRQChannelCmd = ENABLE;
	NVIC_Init(&NVIC_InitStructure);		
}
//==================================================================================================
//| 函数名称 | Sound_Output
//|----------|--------------------------------------------------------------------------------------
//| 函数功能 | 配置PA.8作为PWM口，用于输出声音(TIM1_CH1)
//|----------|--------------------------------------------------------------------------------------
//| 调用模块 | 	无
//|----------|--------------------------------------------------------------------------------------
//| 输入参数 |	无
//|----------|--------------------------------------------------------------------------------------       
//| 返回参数 | 	无
//|----------|--------------------------------------------------------------------------------------       
//| 全局变量 |  无
//|----------|-------------------------------------------------------------------------------------- 
//| 函数设计 | 编写人：郑海    时间：2013-08-25 
//|----------|-------------------------------------------------------------------------------------- 
//|   备注   | 
//|----------|-------------------------------------------------------------------------------------- 
//| 修改记录 | 修改人：          时间：         修改内容： 
//==================================================================================================
void SoundOutputPice(u8 type)
{	
	TIM_TimeBaseInitTypeDef TIM_TimeBaseStructure;

	RCC_APB1PeriphClockCmd(RCC_APB1Periph_TIM5, ENABLE); 

	TIM_TimeBaseStructure.TIM_Prescaler = 0;//设置预分频：不预分频
	TIM_TimeBaseStructure.TIM_CounterMode = TIM_CounterMode_Up;//向上计数模式
	TIM_TimeBaseStructure.TIM_Period = SOUND_FREQ_22_05K;       
	TIM_TimeBaseStructure.TIM_ClockDivision = TIM_CKD_DIV1;   //设置时钟分频系数：不分频
	TIM_TimeBaseStructure.TIM_RepetitionCounter = 0x00;
	TIM_TimeBaseInit(TIM5, &TIM_TimeBaseStructure);
	
	if(type == 1)
	{
        SoundData.Index = 0;
        SoundData.Count = 2;
		SoundData.Data[0].Type = SOUND_SPECIFIC;
        SoundData.Data[0].Index = 0;
		SoundData.Data[0].Size = 2205;//22050对应1秒
		SoundData.Data[0].Ptr = WavSoundSpecific;
        
        SoundData.Data[1].Type = SOUND_NORMAL;
		SoundData.Data[1].Index = 0;
		SoundData.Data[1].Size = sizeof(WavSoundData2);
		SoundData.Data[1].Ptr = WavSoundData2;	
	}
	else if(type == 2)
	{
        SoundData.Index = 0;
        SoundData.Count = 2;
		SoundData.Data[0].Type = SOUND_SPECIFIC;
        SoundData.Data[0].Index = 0;
		SoundData.Data[0].Size = 2205;//22050对应1秒
		SoundData.Data[0].Ptr = WavSoundSpecific;
        
		SoundData.Data[1].Type = SOUND_NORMAL;
        SoundData.Data[1].Index = 0;
		SoundData.Data[1].Size = sizeof(WavSoundData3);
		SoundData.Data[1].Ptr = WavSoundData3;	
	}
	else if(type == 3)
	{
        SoundData.Index = 0;
        SoundData.Count = 2;
		SoundData.Data[0].Type = SOUND_SPECIFIC;
        SoundData.Data[0].Index = 0;
		SoundData.Data[0].Size = 4410;//22050对应1秒
		SoundData.Data[0].Ptr = WavSoundSpecific;
        
		SoundData.Data[1].Type = SOUND_NORMAL;
        SoundData.Data[1].Index = 0;
		SoundData.Data[1].Size = sizeof(WavSoundRight);
		SoundData.Data[1].Ptr = WavSoundRight;
	}
	else if(type == 4)
	{
        SoundData.Index = 0;
        SoundData.Count = 2;
		SoundData.Data[0].Type = SOUND_SPECIFIC;
        SoundData.Data[0].Index = 0;
		SoundData.Data[0].Size = 4410;//22050对应1秒
		SoundData.Data[0].Ptr = WavSoundSpecific;
        
		SoundData.Data[1].Type = SOUND_NORMAL;
        SoundData.Data[1].Index = 0;
		SoundData.Data[1].Size = sizeof(WavSoundError);
		SoundData.Data[1].Ptr = WavSoundError;
	}
    else
    {
        SoundData.Index = 0;
        SoundData.Count = 2;
		SoundData.Data[0].Type = SOUND_SPECIFIC;
        SoundData.Data[0].Index = 0;
		SoundData.Data[0].Size = 2205;//22050对应1秒
		SoundData.Data[0].Ptr = WavSoundSpecific;
        
		SoundData.Data[1].Type = SOUND_NORMAL;
        SoundData.Data[1].Index = 0;
		SoundData.Data[1].Size = sizeof(WavSoundData1);
		SoundData.Data[1].Ptr = WavSoundData1;	
    }
    
	TIM_SetCompare2(TIM4, SoundData.Data[SoundData.Index].Ptr[SoundData.Data[SoundData.Index].Index++]);
	
	OPEN_SOUND_SW();
	
	TIM_SetCounter(TIM5,0);//
	TIM_ITConfig(TIM5, TIM_IT_Update, ENABLE);
	TIM_Cmd(TIM4, ENABLE);	
	TIM_Cmd(TIM5, ENABLE);	
	/* Main Output Enable */
	TIM_CtrlPWMOutputs(TIM4, ENABLE);
	while(SOUND_SW_IS_CLOSE != GET_SOUND_SW_STATUS())
    {
        OSTimeDly(1);
    }
}

//将声音2分段播放
void SoundOutput(u8 type)
{
    OPEN_MOTO();
	if(type == 0)
	{
		SoundOutputPice(type);
	}
	else if(type == 1)
	{
		SoundOutputPice(1);
        CLOSE_MOTO();
		OSTimeDlyHMSM(0,0,0,200);
        OPEN_MOTO();
		SoundOutputPice(2);
	}
	else if(type == 2)
	{
		SoundOutputPice(3);
	}
    else if(type == 3)
	{
		SoundOutputPice(4);
        CLOSE_MOTO();
        OSTimeDlyHMSM(0,0,0,200);
        OPEN_MOTO();
        OSTimeDlyHMSM(0,0,0,300);
	}
    CLOSE_MOTO();
}

